  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset represents the elevation values
  within individual local NHDPlusV2 catchments and upstream, contributing watersheds
  based on the National Elevation Dataset (see Data Sources for links to NHDPlusV2
  data and NED data). NHDPlusV2 records NED snapshot dates as follows: August 2010
  - VPU04 February 2011 - VPUs 05, 06 June 2011 - VPU 17 August 2011 - VPUs 07, 10L,
  10U, 11, 18 December 2011 - VPUs 01, 02, 03N, 03S, 03W, 08, 09, 12, 13, 14, 15,
  16 The elevation characteristics were summarized to produce local catchment-level
  and watershed-level metrics as a continuous data type (see Data Structure and Attribute
  Information for a description).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
